import { memo } from 'react';

import styles from '../../styles/_resets.module.css';
import { BackgroundIcon } from './BackgroundIcon';
import { BgIcon } from './BgIcon';
import { BgIcon2 } from './BgIcon2';
import { BgIcon3 } from './BgIcon3';
