import { EmailIcon3 } from './EmailIcon3';
import { EmailIcon4 } from './EmailIcon4';
import { EmailIcon5 } from './EmailIcon5';
import { FinanceIcon } from './FinanceIcon';
import { FoodIcon } from './FoodIcon';
import { GearIcon } from './GearIcon';
import { GearIcon2 } from './GearIcon2';
import { GroupIcon } from './GroupIcon';
import { HomeIcon } from './HomeIcon';
import { IconEnvelopeClosedIcon } from './IconEnvelopeClosedIcon';
import { IconFileIcon } from './IconFileIcon';
import { IconSchoolIcon } from './IconSchoolIcon';
import { LineIcon } from './LineIcon';
import { NotificationIcon } from './NotificationIcon';
