import { UserIcon5 } from './UserIcon5';
import { UserIcon6 } from './UserIcon6';

// Converted Function Component
export const CoordinatorDashboardDashboard = memo(function CoordinatorDashboardDashboard(props) {
  return (
    <div className={`${resets.clapyResets} ${classes.root}`}>
      <div className={classes.background}></div>
      <div className={classes.list}>
        <div className={classes.dashboard}>
          <div className={classes.home}>
            <HomeIcon className={classes.icon} />
          </div>
          <div className={classes.dashboard2}>Dashboard</div>
        </div>
        <div className={classes.students}>
          <div className={classes.IconSchool}>
            <IconSchoolIcon className={classes.icon2} />
          </div>
          <div className={classes.email}>High Schools</div>
        </div>
        {/* Add remaining JSX structure here */}
        <div className={classes.upcomingTours}>Upcoming Tours</div>
        <div className={classes.list2}>
          <div className={classes._111}>
            <div className={classes.background53}></div>
            <div className={classes.placeholder15}></div>
            <div className={classes.highSchoolA}>High School A</div>
            <div className={classes.INV001234}>Time Slot</div>
            <div className={classes.date39}>Date</div>
            <div className={classes.johnDoe}>John Doe</div>
            <div className={classes.INV0012342}>Guide</div>
          </div>
          {/* Add remaining list items here */}
        </div>
      </div>
    </div>
  );
});

export default CoordinatorDashboardDashboard;
